import React from "react";
import elementImage from "../imgs/5-elements.webp";
import "./bazi.css";

const Bazi = () => {
  return (
    <div className="bazi-container">
      <div className="bazi-left-box">
        {/*   <div className="box-left"></div> */}
        <h1 className="bazi-left-title">What is Bazi?</h1>
        <h2 className="bazi-left-second-title">八字 / Ba Zi / </h2>
        <p className="bazi-left-body">
          BaZi is an ancient art of destiny reading from China. Traditionally
          used to tell one’s fortune, it was also considered as a concept for
          <strong>Metaphysics, Numerology and Astrology</strong>. I practice
          BaZi with a modern approach, redefining traditional fortune telling to
          personal guidance to the well-being of life. Inside each one of us
          lives a unique balance of energy, reflecting in our BaZi charts. It is
          based on complex combinations of Chinese characters and the following
          five elements: wood, fire, earth, metal and water. Furthermore, BaZi
          is also linked to Traditional Chinese Medicine and the application of
          FengShui. It is the ancient wisdom of energy and balance. BaZi tells
          us about who we are, such as information on the state of our health,
          our personality traits, conscious and subconscious thoughts, also our
          actions and interactions with the universe.
        </p>
      </div>
      <img src={elementImage} className="element-image" alt="five elements" />
    </div>
  );
};

export default Bazi;
